using namespace std;

class Domain {
public:
    Domain(string name) : name_(move(name)) {
        name_.insert(0, 1, '.');
    }
    bool operator==(const Domain& other) const {
        return name_ == other.name_;
    }
    bool operator<(const Domain& other) const {
        return lexicographical_compare(name_.rbegin(), name_.rend(), other.name_.rbegin(), other.name_.rend());
    }
    bool IsSubdomain(const Domain& root) const {
        string reverse_domain = string{ name_.rbegin(), name_.rend() };
        string reverse_root = string{ root.name_.rbegin(), root.name_.rend() };
        if (reverse_domain.find(reverse_root) == 0) {
            return true;
        }
        return false;
    }
    void SetName(string name) {
        name_ = move(name);
    }
private:
    string name_;
};

template <typename InputIt>
class DomainChecker {
public:
    DomainChecker(InputIt begin, InputIt end) : sorted_domains{begin, end} {
        sort(sorted_domains.begin(), sorted_domains.end());
    }
    bool IsForbidden(const Domain& domain) {
        auto it = upper_bound(sorted_domains.begin(), sorted_domains.end(), domain);
        if (it == sorted_domains.begin()) {
            return false;
        }
        return domain.IsSubdomain(*prev(it));
    }
private:
    vector<Domain> sorted_domains;
};

vector<Domain> ReadDomains(istream& in, int count) {
    vector<Domain> domains;
    for (int i = 0; i < count; ++i) {
        string domain_name;
        getline(in, domain_name);
        domains.push_back(Domain(domain_name));
    }
    return domains;
}


template <typename Number>
Number ReadNumberOnLine(istream& input) {
    string line;
    getline(input, line);

    Number num;
    std::istringstream(line) >> num;

    return num;
}

void TestIsSubdomain() {
    Domain d{ "abc.com.ru" };
    assert(d.IsSubdomain(Domain{ "ru" }));
    assert(!d.IsSubdomain(Domain{ ".om" }));
    assert(d.IsSubdomain(Domain{ "com.ru" }));
    assert(!d.IsSubdomain(Domain{ "xyz.abc.com.ru" }));
    assert(d.IsSubdomain(Domain{ "abc.com.ru" }));
}

int main() {
    TestIsSubdomain();

    const std::vector<Domain> forbidden_domains = ReadDomains(cin, ReadNumberOnLine<size_t>(cin));
    DomainChecker checker(forbidden_domains.begin(), forbidden_domains.end());

    const std::vector<Domain> test_domains = ReadDomains(cin, ReadNumberOnLine<size_t>(cin));
    for (const Domain& domain : test_domains) {
        cout << (checker.IsForbidden(domain) ? "Bad"sv : "Good"sv) << endl;
    }
}

