import java.util.Arrays;
import java.util.Scanner;

public class QuickSort {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        int[] arr = Arrays.stream(scanner.nextLine().split(" ")).mapToInt(Integer::parseInt).toArray();

        mergeSort(arr, arr.length);
        System.out.println(Arrays.toString(arr).replaceAll("[\\[\\],]", ""));
    }

    private static void mergeSort(int[] arr, int length) {
        if (length < 2) {  // Base case: If the length is 1 there is no need of sorting.
            return;
        }

        int middleIndex = length / 2;  // Find the middle of current array in order to divide it in two smaller arrays.
        int[] leftArr = new int[middleIndex];  // Create first new array (left part of the original)
        int[] rightArr = new int[length - middleIndex];  // Create second new array (right part of the original)

        for (int i = 0; i < middleIndex; i++) {
            leftArr[i] = arr[i];  // Fill the first new array with the element from the original one.
        }

        for (int i = middleIndex; i < length; i++) {
            rightArr[i - middleIndex] = arr[i];  // Fill the second new array with the element from the original one.
        }

        mergeSort(leftArr, middleIndex);  // Call the method again with left array.
        mergeSort(rightArr, length - middleIndex);  // Call the method again with right array.

        merge(arr, leftArr, rightArr); // Call the method merge() in order to sort the two arrays (left and right) in one array (result).
    }

    public static void merge(int[] arr, int[] leftArr, int[] rightArr) {
        int leftSize = leftArr.length;
        int rightSize = rightArr.length;

        int positionInLeftArr = 0;  // current position in leftArr;
        int positionInRightArr = 0;  // current position in rightArr;
        int positionInSortedArr = 0;  // current position in sortedArr;

        while (positionInLeftArr < leftSize && positionInRightArr < rightSize) {  // Check if the positions(indexes) are valid for the arrays.
            if (leftArr[positionInLeftArr] <= rightArr[positionInRightArr]) {  // Check if number of leftArr is smaller or equal from the number from rightArr.
                arr[positionInSortedArr++] = leftArr[positionInLeftArr++];  // Add the number from leftArr in sortedArr.
            } else {
                arr[positionInSortedArr++] = rightArr[positionInRightArr++];  // Add the number from rightArr in sortedArr.
            }
        }

        while (positionInLeftArr < leftSize) {  
            arr[positionInSortedArr++] = leftArr[positionInLeftArr++];
        }

        while (positionInRightArr < rightSize) {
            arr[positionInSortedArr++] = rightArr[positionInRightArr++];
        }
    }

}

