    void Book(uint64_t time, const string& hotel, int client_id, int room_count) {
        container_[hotel].push_back({ time, client_id, room_count });
        for (auto& [_, deq] : container_) {
            while (IsOutdated(time, deq.front().time)) {
                deq.pop_front();
            }
        }
    }

    int ComputeClientCount(const string& hotel) {
        set<int> clients;
        if (container_.count(hotel) != 0) {
            for (const auto& deq : container_.at(hotel)) {
                clients.insert(deq.client_id);
            }
        }
        return clients.size();
    }

    int ComputeRoomCount(const string& hotel) {
        int rooms = 0;
        if (container_.count(hotel) != 0) {
            for (const auto& deq : container_.at(hotel)) {
                rooms += deq.room_count;
            }
        }
        return rooms;
    }

private:
    bool IsOutdated(uint64_t current_time, uint64_t time) {
        return !(current_time >= 86400 ? (current_time - 86400) < time : true && time <= current_time);
    }
    map<string, deque<Booking>> container_;
};

int main() {
    HotelManager manager;

    int query_count;
    cin >> query_count;

    for (int query_id = 0; query_id < query_count; ++query_id) {
        string query_type;
        cin >> query_type;

        if (query_type == "BOOK") {
            int64_t time;
            cin >> time;
            string hotel_name;
            cin >> hotel_name;
            int client_id, room_count;
            cin >> client_id >> room_count;
            manager.Book(time, hotel_name, client_id, room_count);
        }
        else {
            string hotel_name;
            cin >> hotel_name;
            if (query_type == "CLIENTS") {
                cout << manager.ComputeClientCount(hotel_name) << "\n";
            }
            else if (query_type == "ROOMS") {
                cout << manager.ComputeRoomCount(hotel_name) << "\n";
            }
        }
    }

    return 0;
}

