public interface List<E> extends Iterable<E> {
    void add(int index, E element);
    
    void add(E element);
 
    E remove(int index);
    
    boolean remove(E element);
    
    E get(int index);
    
    E set(int index, E element);
    
    boolean contains(E element);
    
    int indexOf(E element);
    
    int size();
    
    void clear();
    
    boolean isEmpty();
}

import java.util.Iterator;

public class CircularLinkedList <E> implements List <E> {

  private class Node {
    E value;
    Node next;
    Node prev;
  }

  Node head;
  int size;
  Node finger; // Finger reference

  public CircularLinkedList() {
    this.head = new Node();
    this.head.next = head;
    this.head.prev = head;
    this.size = 0;
    this.finger = head; // Finger points to the head node initially
  }

  public void add(int index, E value) {
    Node cur = (index == size) ? head : getNodeAt(index);
    Node newNode = new Node();
    newNode.value = value;
    newNode.prev = cur.prev;
    newNode.next = cur;
    newNode.prev.next = newNode;
    newNode.next.prev = newNode;

    // Updates the finger reference if necessary
    if (index <= indexOfBookmark()) {
      finger = newNode;
    }

    this.size++;
  }

  public void add(E value) {
    add(size, value);
  }

  public E remove(int index) {
    Node toRemove = getNodeAt(index);
    toRemove.prev.next = toRemove.next;
    toRemove.next.prev = toRemove.prev;
    toRemove.prev = null;
    toRemove.next = null;

    // Updates the finger reference if necessary
    if (index <= indexOfBookmark()) {
      finger = finger.prev;
    }

    this.size--;
    return toRemove.value;
  }

  public boolean remove(E value) {
    int index = indexOf(value);
    if (index == -1) {
      return false;
    }
    remove(index);
    return true;
  }

  public int indexOf(E value) {
    Node itr = this.head.next;
    int i = 0;
    while (itr != head) {
      if (itr.value.equals(value)) {
        // Updates the finger reference to the found node
        finger = itr;
        return i;
      }
      itr = itr.next;
      i++;
    }
    return -1;
  }

  public boolean contains(E value) {
    return indexOf(value) != -1;
  }

  public E get(int index) {
    Node node;
    int forwardSteps = Math.abs(index - indexOfBookmark());
    int backwardSteps = size - forwardSteps;

    if (forwardSteps <= backwardSteps) {
      node = finger;
      for (int i = 0; i < forwardSteps; i++) {
        node = node.next;
      }
    } else {
      node = finger;
      for (int i = 0; i < backwardSteps; i++) {
        node = node.prev;
      }
    }

    finger = node;
    return node.value;
  }

  public E set(int index, E value) {
    Node cur = getNodeAt(index);
    E oldValue = cur.value;
    cur.value = value;

    // Updates the finger reference if necessary
    if (index == indexOfBookmark()) {
      finger = cur;
    }

    return oldValue;
  }

  public int size() {
    return this.size;
  }

  public void clear() {
    this.size = 0;
    this.head.next = head;
    this.head.prev = head;

    // Resets the finger reference to the head node
    finger = head;
  }

  public boolean isEmpty() {
    return this.size == 0;
  }

  public int indexOfBookmark() {
    if (finger == head) {
      return -1; // Finger is pointing to head node
    }

    Node itr = head.next;
    int index = 0;
    while (itr != head) {
      if (itr == finger) {
        return index; // Found the finger position
      }
      itr = itr.next;
      index++;
    }
    return -1; // Finger not found
  }

  public E getBookmark() {
    if (finger != head) {
      return finger.value; // Return the element pointed by the finger
    }
    return null; // Finger is pointing to head node
  }

  @Override
  public String toString() {
    StringBuilder tmp = new StringBuilder("[");

    for (Node cur = head.next; cur != head; cur = cur.next) {
      tmp.append(cur.value).append(", ");
    }

    if (tmp.length() > 1) {
      tmp = tmp.delete(tmp.length() - 2, tmp.length());
    }

    return tmp.append("]").toString();
  }

  @Override
  public Iterator < E > iterator() {
    return new Iterator < E > () {
      Node cur = head;

      @Override
      public boolean hasNext() {
        return cur.next != head;
      }

      @Override
      public E next() {
        if (!hasNext()) {
          throw new IndexOutOfBoundsException();
        }
        cur = cur.next;
        return cur.value;
      }
    };
  }

  private Node getNodeAt(int index) {
    if (index < 0 || index >= size) {
      throw new IndexOutOfBoundsException();
    }

    Node itr = this.head;
    for (int i = 0; i <= index; i++) {
      itr = itr.next;
    }

    return itr;
  }
  
  //Output Test
  public static void main(String[] args) {
    CircularLinkedList < Integer > list = new CircularLinkedList < > ();
    list.add(10);
    list.add(20);
    list.add(30);
    list.add(40);

    System.out.println(list);
    System.out.println("Size: " + list.size());

    list.add(2, 25);
    System.out.println(list);
    System.out.println("Size: " + list.size());

    list.remove(3);
    System.out.println(list);
    System.out.println("Size: " + list.size());

    int index = list.indexOf(25);
    System.out.println("Index of 25: " + index);

    int value = list.get(1);
    System.out.println("Value at index 1: " + value);

    list.set(3, 45);
    System.out.println(list);
    System.out.println("Size: " + list.size());

    list.clear();
    System.out.println(list);
    System.out.println("Size: " + list.size());
  }
}

